import logo from './logo.svg';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import './App.css';
import NavBar from "./NavBar/NavBar";

function App() {
  return (
<Router>
  <Switch>
    <div className="App">
      <NavBar />

    </div>
  </Switch>
</Router>
  );
}

export default App;
